import React from 'react';

const RoomsieLogo = ({ width, height, color, scale }) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    width={width * scale}
    height={height * scale}
  >
    <image
      x="0px"
      y="0px"
      width={width * scale}
      height={height * scale}
      href="data:img/png;base64,"
    />
  </svg>
);

RoomsieLogo.defaultProps = {
  width: 170,
  height: 28,
  color: 'black',
  scale: 1
};

export default RoomsieLogo;
